    <div id="text-title">

<script src="https://code.jquery.com/jquery-3.3.1.min.js"></script>
<script>
    function clear(){
        $("#text-title").text("Hover over the circles");
        $("#text-body").text("to learn more about what sets our product apart from others on the market.")
    }


    $("#easy").mouseover(function(){
        $("#text-title").text("Easy");
        $("#text-body").text("RT Linux, drivers provided. Transparent error correction codes. System management made easy with IPMI. Open standards.")
    });
    $("#easy").mouseout(clear());


    $("#affordable").mouseover(function(){
        $("#text-title").text("Affordable");
        $("#text-body").text("Significantly less expensive than traditional rad-hard electronics. NRE costs distributed across multiple missions.")
    });
    $("#affordable").mouseout(clear());


    $("#modular").mouseover(function(){
        $("#text-title").text("Modular");
        $("#text-body").text("Use the same building blocks in multiple subsystems and missions. Mission specific electronics constrained to the mezzanine card.")
    });
    $("#modular").mouseout(clear());


    $("#reliable").mouseover(function(){
        $("#text-title").text("Reliable");
        $("#text-body").text("Radiation tolerant design based on error correction codes, shielding, redundancy, and the heritage and testing of components.")
    });
    $("#reliable").mouseout(clear());


    $("#powerful").mouseover(function(){
        $("#text-title").text("Powerful");
        $("#text-body").text("Tens of Gbps interfaces and powerful yet reliable components.  Complex tasks performed not by individual boxes but by modules connected via a high throughput backplane.")
    });
    $("#powerful").mouseout(clear());









</script>
